import { allProductsActions } from "../store/all-products-slice";

const useFetchProducts = () => {
    const dispatch = useDispatch()
    fetch('https://abstrakt-5e25f-default-rtdb.europe-west1.firebasedatabase.app/products/').then(response => {
        return response.json();
    }).then(data => dispatch(allProductsActions.insertProducts(data)))
}

export default useFetchProducts
